define("curl/plugin/text!app/game/template.html",function(){return'<div class="hidden" >\r\n    <div class="container">\r\n        <div readonly id="message"></div>\r\n        <div style="display:inline-block;float:left;width:2%">&nbsp;</div> <br/>\r\n        <div class="blockCanvas">\r\n            <canvas id="canvasGrid" width="1000" height="1000"></canvas>\r\n            <canvas id="canvasWalls" width="1000" height="1000"></canvas>\r\n            <canvas id="canvasTurtles" width="1000" height="1000"></canvas>\r\n        </div>\r\n        <div class="blockScriptChat">\r\n            <div class="script">\r\n                <h4><span>Script</span>\r\n                    <span ><img class="belldsl" width="25px" src="theme/images/bell.png"/></span></h4>\r\n                <ul>\r\n                    <li class="dsl-text">\r\n                        <textarea class="topcoat-textarea" rows="6" cols="30" name="name" id="input-move-name"></textarea><br/><br/>\r\n                        <button class="topcoat-button submit-game">Execute</button>\r\n                    </li>\r\n                </ul>\r\n            </div>\r\n            <div class="chat" >\r\n                <h4><span>Chat</span>\r\n                    <span ><img class="bell" width="25px" src="theme/images/ringtone.png"/></span></h4>\r\n                <ul >\r\n                    <li class="chat-text" >\r\n                        <div class="interaction2">\r\n                            <textarea class="topcoat-textarea" rows="6" cols="30" readonly id="interaction"></textarea>\r\n                            <br/><br/>\r\n                            <input class="width--100 topcoat-text-input" disabled="true" id="response" placeholder="Place your answer here"></input><br/><br/>\r\n                            <button class=" topcoat-button answer">Answer</button>\r\n                        </div>\r\n                    </li>\r\n                </ul>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <input type="hidden" name="id" class="input-game-id"/>\r\n    <input type="hidden" name="user-id" class="input-user1-move"/>\r\n    <input type="hidden" name="version" class="input-game-version"/>\r\n    <input type="hidden" name="class" class="input-game-class"/>\r\n</div>'});
define("curl/plugin/text!app/exit/template.html",function(){return'<div class="hidden exit-view">\n    <div class="center-wrapper">\n        <div class="won">\n            <h1>Happy Ending!</h1><br/><br/>\n            <p>Emily and Franklin met.</p>\n            <p>And they lived happily ever after...</p><br/><br/>\n        </div>\n        <div class="lost">\n            <h1>Too bad</h1><br/><br/>\n            <p>Birdy was quicker</p>\n            <p>But you can make it...</p><br/><br/>\n        </div>\n        <div class="partner-left">\n            <h1>Too bad</h1><br/><br/>\n            <p>Your partner left the room</p>\n            <p>Do you want to play again?</p><br/><br/>\n        </div>\n        <div  class="giveup">\n            <h1>Too bad</h1><br/><br/>\n            <p>You left the room</p>\n            <p>Do you want to play again?</p><br/><br/>\n        </div>\n        <div class="nobody">\n            <h1>Too bad</h1><br/><br/>\n            <p>Nobody is playing</p>\n            <p>Do you want to try again?</p><br/><br/>\n        </div>\n        <div class="tooslow">\n            <h1>Too bad</h1><br/><br/>\n            <p>Someone was faster than you</p>\n            <p>Do you want to try again?</p><br/><br/>\n        </div>\n        <button class="topcoat-button start">Play Again !</button>\n    </div>\n</div>\n'});
define("curl/plugin/text!app/help/template.html",function(){return'<div class="center-wrapper games-view hidden">\n    <br/>\n    <h1>How to play?</h1>\n    <p class="boxed-help-text">Franklin is lost in the maze, help him to meet Emily at the Heart before Birdy reaches the heart.\n        Franklin speaks Groovy and emily is into Scala. Both lang\n        Using a special commands, you can move, change the meeting point, ask question to your partner.</p>\n     <h1>Rules</h1>\n    <p class="boxed-help-text">Each player takes turn. Franklin start the game by writing his script.\n        A script can not contain more than 3 specials commands.\n        Franklin speaks Groovy (blue) and Emily is into Scala (red). Programmers can use plain Groovy/Scala in their script.\n\n\n    <div class="boxed-help clear">\n        <h1>Special Commands</h1> <br/>\n        <div class="col1">move up<br/>\n            move left by 2<br/>\n            kiss<br/>\n            ask "Change meeting?" assign to response <br/>\n            if(response == "y") meet x:12, y:1 <br/>\n        </div>\n        \x3c!--<div style="float:left;width:1%">&nbsp;</div>--\x3e\n        <div class="col2">I move up<br/>\n            I move left by 2<br/>\n            I kiss;<br/>\n            val response = I ask "Change meeting?" <br/>\n            if(response == "y") meet (12, 1) <br/>\n        </div>\n    </div>\n    <br/> <br/><br/>\n    <button class="exit-help topcoat-button--large play">Enjoy !</button>\n</div>'});
define("curl/plugin/text!app/player/template.html",function(){return'<div class="hidden player-view">\n    <div class="clear center-wrapper">\n        <br/><h2>What is your name?</h2><br/> <br/>\n        <input id="player" type="text" class="topcoat-text-input" value="" placeholder="">\n        <br/> <br/><br/>\n        <button class="topcoat-button--large player">&nbsp;&nbsp;&nbsp;Play Now!&nbsp;&nbsp;</button>\n    </div>\n</div>\n'});
